import { useHistory } from "react-router-dom";
import Card from "../components/UI/Card";
import "./LiveChat.css";

const LiveChat = () => {
  const history = useHistory();

  // Render component
  return (
    <div className="live-chat px-3 py-5">
      <h5>Live chat</h5>
      <Card className="mt-4 p-3 row">
        <div className="live-chat__left col ">Chat list</div>
        <div className="live-chat__right col">Chatting</div>
      </Card>
    </div>
  );
};

export default LiveChat;
